  false,\n\t\"url\": null,\n\t\"notes\": \"The TIGER/Line shapefiles and related database
  files (.dbf) are an extract of selected geographic and cartographic information
  from then               U.S. Census Bureau's Master Address File / Topologically
  Integrated Geographic Encoding and Referencing (MAF/TIGER) Database (MTDB).  The
  MTDB representsn               a seamless national file with no overlaps or gaps
  between parts, however, each TIGER/Line shapefile is designed to stand alone as
  an independent data set,n               or they can be combined to cover the entire
  nation.nn               Census tracts are small, relatively permanent statistical
  subdivisions of a county or equivalent entity, and were defined by local participants
  as partn               of the 2010 Census Participant Statistical Areas Program.
  \ The Census Bureau delineated the census tracts in situations where no local participantn
  \              existed or where all the potential participants declined to participate.
  \ The primary purpose of census tracts is to provide a stable set of geographicn
  \              units for the presentation of census data and comparison back to
  previous decennial censuses.  Census tracts generally have a population size betweenn
  \              1,200 and 8,000 people, with an optimum size of 4,000 people.  When
  first delineated, census tracts were designed to be homogeneous with respect ton
  \              population characteristics, economic status, and living conditions.
  \ The spatial size of census tracts varies widely depending on the density ofn               settlement.
  \ Physical changes in street patterns caused by highway construction, new development,
  and so forth, may require boundary revisions. Inn               addition, census
  tracts occasionally are split due to population growth, or combined as a result
  of substantial population decline.  Census tractn               boundaries generally
  follow visible and identifiable features.  They may follow legal boundaries such
  as minor civil division (MCD) or incorporatedn               place boundaries in
  some States and situations to allow for census tract-to-governmental unit relationships
  where the governmental boundaries tend ton               remain unchanged between
  censuses.  State and county boundaries always are census tract boundaries in the
  standard census geographic hierarchy.  In a fewn               rare instances, a
  census tract may consist of noncontiguous areas.  These noncontiguous areas may
  occur where the census tracts are coextensive with alln               or parts of
  legal entities that are themselves noncontiguous.  For the 2010 Census, the census
  tract code range of 9400 through 9499 was enforced forn               census tracts
  that include a majority American Indian population according to Census 2000 data
  and/or their area was primarily covered by federallyn               recognized American
  Indian reservations and/or off-reservation trust lands; the code range 9800 through
  9899 was enforced for those census tracts thatn               contained little or
  no population and represented a relatively large special land use area such as a
  National Park, military installation, or an               business/industrial park;
  and the code range 9900 through 9998 was enforced for those census tracts that contained
  only water area, no land area.  n            \",\n\t\"license_title\": null,\n\t\"extras\":
